export function diffLocationKeys(a, b) {
    const locationKeys = {};
    const missingLocationKeys = {};
    for (const location of a) {
        locationKeys[location.key] = true;
    }
    for (const location of b) {
        if (!locationKeys[location.key]) {
            missingLocationKeys[location.key] = true;
        }
    }
    return missingLocationKeys;
}
